import Head from 'next/head';
import Header from './Header';
import './Layout.scss';

export default function Layout(Pages) {

  return () => (
    <>
      <Head>
        <title>Marquee Test</title>
        <meta
          name="viewport"
          content="initial-scale=1.0, width=device-width"
          charSet="utf-8"
          key="viewport"
        />
      </Head>

      <div className="layout">
        <Header />
        <Pages />
      </div>
    </>
  )
}
